INSERT INTO `v1_8df7f19d210b49ce07464b26b0faa825d1e7dadce18c1c8ae70d16871ec070c8` VALUES ("", 2, 3, "---", 6000, 1, "アサヒ", 0, 1, "逆境に屈することなく、部員たちを引っ張る主将。ミート力を活かした安定感のある打撃が持ち味。");
INSERT INTO `v1_8df7f19d210b49ce07464b26b0faa825d1e7dadce18c1c8ae70d16871ec070c8` VALUES ("ホームランを連発すると、連発数に応じてパワーアップする", 3, 0, "アドレナリン", 16000, 3, "部員3", 3, 1, "無愛想だが仲間を大切に想う気持ちは誰よりも強い男。ケンカで鍛えた腕っぷしが自慢のパワーヒッター。");
INSERT INTO `v1_8df7f19d210b49ce07464b26b0faa825d1e7dadce18c1c8ae70d16871ec070c8` VALUES ("幸運のハプニングを呼び込む", 4, 2, "ラッキー", 30000, 2, "{0}", 2, 1, "みんなからの厚い信頼を集める期待の助っ人部員。実力は未知数だが幸運なハプニングを呼び込む。");
